import styled from 'styled-components';

const LegendColorBox = styled.span`
  width: 10px;
  height: 10px;
  display: inline-block;
  margin-right: 5px;
  border-radius: 100%;
  background: ${props => props.color};
`;

export { LegendColorBox };
